            var fast_marker_cluster_bbb8791ba7b9efedf9351ea2607ae788 = (function(){
                
                var callback = function (row) {
                    var icon = L.AwesomeMarkers.icon();
                    var marker = L.marker(new L.LatLng(row[0], row[1]));
                    marker.setIcon(icon);
                    return marker;
                };

                var data = [];
                var cluster = L.markerClusterGroup({"disableClusteringAtZoom": 15});

                for (var i = 0; i < data.length; i++) {
                    var row = data[i];
                    var marker = callback(row);
                    marker.addTo(cluster);
                }

                cluster.addTo(map_c5584813a71b2a293a56a97d9206bcb4);
                return cluster;
            })();

            var fast_marker_cluster_a5d8e8200e78abde3d1895278de1f32f = (function(){
                
                var callback = function (row) {
                    var icon = L.AwesomeMarkers.icon();
                    var marker = L.marker(new L.LatLng(row[0], row[1]));
                    marker.setIcon(icon);
                    return marker;
                };

                var data = [];
                var cluster = L.markerClusterGroup({"disableClusteringAtZoom": 12});

                for (var i = 0; i < data.length; i++) {
                    var row = data[i];
                    var marker = callback(row);
                    marker.addTo(cluster);
                }

                cluster.addTo(map_c5584813a71b2a293a56a97d9206bcb4);
                return cluster;
            })();
